import { Component } from "react";
import Contacts from "../Contacts/Contacts";


export default class Home extends Component{

    state = {
        products: [
            {id:1 , name:"iphone" , code:123 , price:20000, onSale:false},
            {id:2 , name:"iphone" , code:123 , price:20000, onSale:true},
            {id:3 , name:"iphone" , code:123 , price:20000, onSale:false},
            {id:4 , name:"iphone" , code:123 , price:20000, onSale:false},
            {id:5 , name:"iphone" , code:123 , price:20000, onSale:true},
            {id:6 , name:"iphone" , code:123 , price:20000, onSale:false},
            {id:7 , name:"iphone" , code:123 , price:20000, onSale:false},
            {id:8 , name:"iphone" , code:123 , price:20000, onSale:false},
            {id:9 , name:"iphone" , code:123 , price:20000, onSale:true},
            {id:10 , name:"iphone" , code:123 , price:20000, onSale:false},
            {id:11 , name:"iphone" , code:123 , price:20000, onSale:true}
        ]
    }
    render() {
        return <>
        <div className="container">
                <div className="bg-dark p-4">
                <div className="row gy-3">
                {this.state.products.map((x) => <Contacts delete={this} key={x.id} productDetails= {x} />)}
                </div>
                </div>
        </div> 
        </>
            
        
        
    }
}
